	// the state vector
	state_array[0] = ownState.position.x - ownTarget[0];
	state_array[1] = ownState.position.y - ownTarget[1];
	state_array[2] = ownState.position.z - ownTarget[2];
	state_array[3] = ownState.velocity.x;
